import { makeStyles } from "@material-ui/core";
import React from "react";

interface IProps {
  isShown: boolean;
  setIsShown: Function;
}

const useStyles = makeStyles({
    container: {
        position: "aboslute",
    }
})

const SearchModal: React.FC<IProps> = ({ isShown, setIsShown }) => {
  if (!isShown) return <></>;
  return <p>yo</p>;
};

export default SearchModal;
